	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.instance_1,p:{scaleX:0.3576,scaleY:0.2308,x:701.95,y:428,skewY:180}},{t:this.text,p:{scaleX:1,x:541.05,y:457.55,text:"This is your EMR home page! Lets start by navigating to a patient. Choose 'Select a Patient' above. ",font:"20px 'Times'",lineHeight:22,lineWidth:271}}]}).to({state:[{t:this.instance_1,p:{scaleX:0.3106,scaleY:0.1447,x:701,y:420,skewY:180}},{t:this.text,p:{scaleX:0.8545,x:562.7588,y:435.5,text:"Choose patient John Doe from your active patient list",font:"24px 'Times'",lineHeight:26,lineWidth:280}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.2177,x:40,y:413,skewY:0}},{t:this.text,p:{scaleX:1,x:207,y:440.45,text:"Finally, click 'Retrieve' to open the patient's record",font:"24px 'Times'",lineHeight:26,lineWidth:213}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.2177,x:703,y:595,skewY:180}},{t:this.text,p:{scaleX:1,x:539.45,y:613.4,text:"This is the patient record! The top section includes the patient contact information",font:"24px 'Times'",lineHeight:26,lineWidth:288}}]},1).to({state:[{t:this.shape},{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.2177,x:703,y:254,skewY:180}},{t:this.text,p:{scaleX:1,x:534.45,y:268.5,text:"Uploaded documents have additional contact information, as well as the medical history of the patient. Go ahead and open this patient's H&P.",font:"20px 'Times'",lineHeight:22,lineWidth:288}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.2177,x:703,y:468,skewY:180}},{t:this.text_1,p:{x:533.45,y:487.05,text:"Uploaded documents will differ, depending on the agency. But all should have the medical history, insurance, MD, and alternative contact information. ",lineWidth:288,font:"20px 'Times'",lineHeight:22}},{t:this.text,p:{scaleX:1,x:193.5,y:190.45,text:"",font:"20px 'Times-Roman'",lineHeight:22,lineWidth:100}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.2177,x:40,y:412,skewY:0}},{t:this.text,p:{scaleX:1,x:208.45,y:430.35,text:"Now that we have the patient's contact information, lets give the patient a call and put in a Scheduling Therapy Order with the date they want to be seen.  ",font:"20px 'Times'",lineHeight:22,lineWidth:276}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.2177,x:706,y:399,skewY:180}},{t:this.text,p:{scaleX:1,x:542.5,y:425.55,text:"Choose 'Other Forms' to open communication notes, therapy orders, and case conference templates.",font:"20px 'Times'",lineHeight:22,lineWidth:276}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3835,scaleY:0.1603,x:706,y:630,skewY:180}},{t:this.text,p:{scaleX:1,x:542.5,y:658.5,text:"Select 'Form Type to' bring up the note template options. ",font:"20px 'Times'",lineHeight:22,lineWidth:276}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.2987,scaleY:0.1447,x:701.85,y:636,skewY:180}},{t:this.text,p:{scaleX:1,x:577.4,y:669.5,text:"Choose Therapy Order",font:"20px 'Times'",lineHeight:22,lineWidth:276}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.2987,scaleY:0.1447,x:701.85,y:636,skewY:180}},{t:this.text,p:{scaleX:1,x:574.05,y:659.5,text:"Finally, press 'Confirm' to begin a therapy order! ",font:"20px 'Times'",lineHeight:22,lineWidth:241}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.7859,scaleY:0.2934,x:27,y:616,skewY:0}},{t:this.text_1,p:{x:362.45,y:647.4,text:"The Scheduling Therapy Order should be formatted as:\n\n'Spoke with (relationship) (name) to schedule (discipline) Evaluation for (date). (reason why family may have delayed Eval, if applicable).' \n\nGo ahead and try writing your order in the box above, then click 'next below'",lineWidth:624,font:"20px 'Times'",lineHeight:22}},{t:this.text,p:{scaleX:1,x:800.45,y:637.4,text:"",font:"20px 'Times-Roman'",lineHeight:22,lineWidth:100}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2933,x:36,y:519,skewY:0}},{t:this.text,p:{scaleX:1,x:243,y:553.5,text:"Every communication note, therapy order, visit note, or case conference must be signed by you.  \n\nPlease click above to sign your name, then click 'next' below to continue. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2724,x:36,y:527,skewY:0}},{t:this.text,p:{scaleX:1,x:243,y:560.5,text:"Every communication note, therapy order, visit note, or case conference must be dated by you.  \n\nPlease click above to date the note, then click 'next' below to continue. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2333,x:36,y:542,skewY:0}},{t:this.text,p:{scaleX:1,x:255,y:579.5,text:"This page gives you a chance to review what you have written.  If everything looks good, press 'Finalize' to submit! ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2672,x:36,y:529,skewY:0}},{t:this.text,p:{scaleX:1,x:243,y:548.5,text:"Okay, now that you've scheduled your Evaluation with the family, lets fast forward to 4/23/19 start the visit! \n\nClick 'My Referrals' above to access your referral inbox.",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2359,x:706.95,y:658,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:689.45,text:"Here you can see a list of your new patients.  \n\nPress 'Select Action' under John Doe to bring up a list of actions. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.1578,x:706.95,y:293,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:311.6,text:"Now, lets choose 'Eval' from the list to bring up the Evaluation page. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.1578,x:706.95,y:603,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:621.55,text:"This gives you a quick snapshot of the patient. \n\nChoose Proceed to Eval. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2099,x:36,y:704,skewY:0}},{t:this.text,p:{scaleX:1,x:243,y:731.55,text:"You don't need to fill anything in here, just double check the date and visit type. \n\nPress 'Proceed'! ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2099,x:36,y:360,skewY:0}},{t:this.text,p:{scaleX:1,x:243,y:387.6,text:"You are now in the Evaluation! At any time you can press 'Save & Exit' below. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}},{t:this.nexteval1}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2099,x:36,y:515,skewY:0}},{t:this.text,p:{scaleX:1,x:243,y:537.6,text:"Every note must have a subjective.  Write how the patient and/or family members feel to give important insight in to their psychosocial state and goals for therapy. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2099,x:705.95,y:442,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:453.6,text:"Every note must have heart rate, blood pressure, respirations, and temperature.  \n\nIf you do not already have your equipment, please start ordering it! ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.1526,x:705.95,y:474,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:493.45,text:"Lets not forget the pain vital! Pain must be addressed at every visit. Go ahead and mark that John Doe is experiencing pain. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.1526,x:705.95,y:487,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:500.9,text:"Lets not forget the pain vital! Pain must be addressed at every visit. Go ahead and mark that John Doe is experiencing pain. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4941,scaleY:0.2073,x:705.95,y:465,skewY:180}},{t:this.text,p:{scaleX:1,x:497,y:485.45,text:"Great job! Now options for filling the patients pain levels have populated.  If a patient has pain, you should fill these in, but for this we are going to skip them. ",font:"20px 'Times'",lineHeight:22,lineWidth:385}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.527,scaleY:0.2673,x:708,y:421,skewY:180}},{t:this.text,p:{scaleX:1,x:482.5,y:441.45,text:"For the Evaluation, you should fill out details of the patient's living situation, especially as they may relate to the plan of care (e.g. a patient with 3 steps to the kitchen may have a goal to safely go up and down 3 steps to complete ADLs)",font:"20px 'Times'",lineHeight:22,lineWidth:378}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5881,scaleY:0.176,x:34,y:118,skewY:0}},{t:this.text,p:{scaleX:1,x:303.5,y:142.5,text:"It's appropriate to have a test to include as an objective measure (and goal) for each Evaluation.  Lets put in a Tinetti for John. ",font:"20px 'Times'",lineHeight:22,lineWidth:378}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5881,scaleY:0.2255,x:34,y:114,skewY:0}},{t:this.text,p:{scaleX:1,x:293.5,y:123.5,text:"The test gives you easy dropdowns to select from for scoring.  Once you're done with each question, you just press 'Submit' and the system scores it for you! \nGo ahead and press 'submit.' We've filled in some answers for you. ",font:"18px 'Times'",lineHeight:20,lineWidth:378}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5881,scaleY:0.2255,x:34,y:114,skewY:0}},{t:this.text,p:{scaleX:1,x:293.5,y:130.5,text:"Now we know that John has only scored a 9/28. Maybe we'll make a goal for him to improve his score to a reasonable 18/28 by discharge.  \n\nThat should allow him to be more independent. ",font:"18px 'Times'",lineHeight:20,lineWidth:378}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5881,scaleY:0.2255,x:709.9,y:407,skewY:180}},{t:this.text,p:{scaleX:1,x:461.45,y:422.4,text:"For the sake of time, we're really only focusing on the vitals, SOAP, goals, and verbal orders.  \n\nBut any sections that apply to your patient should be filled out with the checkboxes, fill in the blanks, etc. to provide enough objective measures and details. ",font:"18px 'Times'",lineHeight:20,lineWidth:428}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5881,scaleY:0.2255,x:708.9,y:465,skewY:180}},{t:this.text,p:{scaleX:1,x:456.45,y:482.4,text:"The Objective section should summarize any objective measures you have taken note of.  \n\nYour Assessment will use these objective measures to assess what the plan for the patient should be.  ",font:"18px 'Times'",lineHeight:20,lineWidth:428}}]},1).to({state:[{t:this.instance_2,p:{scaleX:0.5881,scaleY:0.2255,x:708.9,y:466}},{t:this.text_1,p:{x:456.45,y:482.4,text:"The Objective section should summarize any objective measures you have taken note of.  \n\nYour Assessment will use these objective measures to assess what the plan for the patient should be.  ",lineWidth:428,font:"18px 'Times'",lineHeight:20}},{t:this.instance_1,p:{scaleX:0.3269,scaleY:0.1264,x:701.9,y:632,skewY:180}},{t:this.text,p:{scaleX:1,x:561.5,y:651.9,text:"'Patient tolerated treatment' isn't enough for an assessment! ",font:"18px 'Times'",lineHeight:20,lineWidth:256}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3834,scaleY:0.1655,x:705.85,y:567,skewY:180}},{t:this.text_1,p:{x:456.45,y:427.4,text:"Once you've filled out the plan and any other sections of the note that apply to the patient, you are done with the SOAP portion of the Evaluation! \n\nPress 'Next' to access the next page.",lineWidth:428,font:"18px 'Times'",lineHeight:20}},{t:this.text,p:{scaleX:1,x:532,y:588,text:"Tip: The dropdown menu (where it says 'PT Evaluation') allows you to quickly jump around the note. ",font:"18px 'Times'",lineHeight:20,lineWidth:257}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4634,scaleY:0.2204,x:705.9,y:150,skewY:180}},{t:this.text,p:{scaleX:1,x:510.5,y:163.05,text:"You can either write your own exercises in to the 'additional information' box or pull up exercises in the system library.\n\nLets add a heel raise exercise.  Start by selecting the body area. ",font:"18px 'Times'",lineHeight:20,lineWidth:340}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3188,scaleY:0.1603,x:703,y:277,skewY:180}},{t:this.text,p:{scaleX:1,x:564,y:297.75,text:"Now choose 'ankle/foot' to pull up a list of ankle and foot exercises. ",font:"18px 'Times'",lineHeight:20,lineWidth:223}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3188,scaleY:0.1603,x:703,y:358,skewY:180}},{t:this.text,p:{scaleX:1,x:564,y:392.75,text:"We'll have to scroll down to find this one. ",font:"18px 'Times'",lineHeight:20,lineWidth:223}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3188,scaleY:0.1603,x:703,y:358,skewY:180}},{t:this.text,p:{scaleX:1,x:564,y:392.75,text:"Click the exercise to add it.",font:"18px 'Times'",lineHeight:20,lineWidth:223}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3188,scaleY:0.1603,x:703,y:358,skewY:180}},{t:this.text,p:{scaleX:1,x:564,y:373.75,text:"Great job!\nLet's move on to the goals on the next page. ",font:"24px 'Times'",lineHeight:26,lineWidth:223}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3917,scaleY:0.2699,x:703.95,y:569,skewY:180}},{t:this.text,p:{scaleX:1,x:537,y:593.7,text:"Goals are organized by category, with templates in each section. \n\nWe wanted to improve Mr. Doe's Tinetti from 9 to 18 by discharge, so let's open up 'Balance'.  ",font:"18px 'Times'",lineHeight:20,lineWidth:287}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3917,scaleY:0.2283,x:38,y:302,skewY:0}},{t:this.text,p:{scaleX:1,x:203,y:327.75,text:"See tinetti down at the bottom? We just need to check the box (indicating we are adding the goal to the care plan) and fill in the blanks.  ",font:"18px 'Times'",lineHeight:20,lineWidth:287}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3305,scaleY:0.1788,x:41,y:471,skewY:0}},{t:this.text,p:{scaleX:1,x:173,y:492.75,text:"There! Now we have a goal for Mr. Doe. Let's move on. ",font:"24px 'Times'",lineHeight:26,lineWidth:227}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3705,scaleY:0.2283,x:702.9,y:510,skewY:180}},{t:this.text,p:{scaleX:1,x:537,y:528.6,text:"Go ahead and skip this calendar. It's only purpose is planning out your frequency.",font:"24px 'Times'",lineHeight:26,lineWidth:227}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3705,scaleY:0.2283,x:702.9,y:510,skewY:180}},{t:this.text,p:{scaleX:1,x:537,y:528.6,text:"Every in-person visit needs a patient or POA signature. \n\nIf you lose signal, please obtain this on paper. ",font:"20px 'Times'",lineHeight:22,lineWidth:227}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3281,scaleY:0.1839,x:700.85,y:527,skewY:180}},{t:this.text,p:{scaleX:1,x:556,y:555.55,text:"Your signature is also needed. ",font:"24px 'Times'",lineHeight:26,lineWidth:227}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3281,scaleY:0.1839,x:700.85,y:527,skewY:180}},{t:this.text,p:{scaleX:1,x:556,y:546.55,text:"And of course the date (which should match the Evaluation date) ",font:"24px 'Times'",lineHeight:26,lineWidth:227}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4387,scaleY:0.2674,x:703.85,y:520,skewY:180}},{t:this.text,p:{scaleX:1,x:513,y:546.55,text:"Double check the time in and time out. Make any corrections. \n\nKeep in mind, the note time starts when you open the visit up.  ",font:"20px 'Times'",lineHeight:22,lineWidth:313}}]},1).to({state:[{t:this.instance_2,p:{scaleX:0.4387,scaleY:0.2674,x:704.85,y:503}},{t:this.text_1,p:{x:513,y:532.55,text:"Finally, we need the verbal orders! \nPer CMS guidelines, you will need to write who you spoke to at the PCP's office, when you spoke to them, and why.  ",lineWidth:313,font:"20px 'Times'",lineHeight:22}},{t:this.instance_1,p:{scaleX:0.3327,scaleY:0.1552,x:39,y:682,skewY:0}},{t:this.text,p:{scaleX:1,x:180,y:709.55,text:"Click the blue next button to see a properly filled out order. ",font:"20px 'Times'",lineHeight:22,lineWidth:271}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4387,scaleY:0.2674,x:704.85,y:503,skewY:180}},{t:this.text,p:{scaleX:1,x:517,y:532.55,text:"Since it's a Monday, the frequency called in was for 2 visits the first week. \n\nTypically from M-W it's best to put in at least 2 visits to minimize gaps in care. ",font:"20px 'Times'",lineHeight:22,lineWidth:327}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4387,scaleY:0.296,x:704.85,y:492,skewY:180}},{t:this.text,p:{scaleX:1,x:517.5,y:512.6,text:"Done! Before Finalizing a note, the system gives you an option to review.\n\nWe only added a Tinetti goal and should really go back in and put some others, though. \n\nSo let's press Save & Exit instead of Finalize.  ",font:"18px 'Times'",lineHeight:20,lineWidth:334}}]},1).to({state:[{t:this.instance_2,p:{scaleX:0.3374,scaleY:0.2647,x:702.85,y:309}},{t:this.text_1,p:{x:555.9,y:360.55,text:"Now your Evaluation is on the patient's record!   ",lineWidth:229,font:"24px 'Times'",lineHeight:26}},{t:this.instance_1,p:{scaleX:0.3374,scaleY:0.2647,x:41,y:564,skewY:0}},{t:this.text,p:{scaleX:1,x:182,y:596.55,text:"The next step is plotting your frequency and visits. \n\nTo do this, lets head back to 'My Referrals'",font:"18px 'Times'",lineHeight:20,lineWidth:265}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3892,scaleY:0.2384,x:702.8,y:563,skewY:180}},{t:this.text,p:{scaleX:1,x:537.9,y:615.95,text:"From John Doe's actions, you will select 'Keep'    ",font:"24px 'Times'",lineHeight:26,lineWidth:257}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3892,scaleY:0.2384,x:702.8,y:563,skewY:180}},{t:this.text,p:{scaleX:1,x:537.9,y:615.95,text:"From John Doe's actions, you will select 'Keep'    ",font:"24px 'Times'",lineHeight:26,lineWidth:257}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.3892,scaleY:0.2384,x:40,y:291,skewY:0}},{t:this.text,p:{scaleX:1,x:203.9,y:311,text:"This is where you plot the frequency and visits. From the side bar, you will select 2w3 and then 1w1.   ",font:"24px 'Times'",lineHeight:26,lineWidth:257}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5139,scaleY:0.3193,x:705.8,y:348,skewY:180}},{t:this.text,p:{scaleX:1,x:487.5,y:372,text:"Great! Now we plot out a rough schedule. \n\nJohn definitely wanted to be seen on Friday after the eval, but from that point onwards, there is nothing set in stone. \n\nLets just plot a consistent schedule for now. These can always be moved within the week. ",font:"18px 'Times'",lineHeight:20,lineWidth:362}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.5985,scaleY:0.4001,x:705.75,y:306,skewY:180}},{t:this.text,p:{scaleX:1,x:449,y:343.35,text:"As we were plotting, the system wouldn't allow us to plot past 5 visits and the red message above appeared.\n\n\"You are currenttly at the max number of visits authorized.\"\n\nDid you notice John wasn't a Medicare patient? Private patients have authorizations, so you can only plot the 5 authorized visits until the rest are approved by John's insurance. \n\nGo ahead an press 'Continue'",font:"18px 'Times'",lineHeight:20,lineWidth:471}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.302,scaleY:0.2697,x:700.65,y:660,skewY:180}},{t:this.text,p:{scaleX:1,x:572,y:703.3,text:"All of the visits are standard visits since you can't yet plot your discharge, so go ahead an press confirm. ",font:"20px 'Times'",lineHeight:22,lineWidth:227}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4596,scaleY:0.2697,x:705.7,y:186,skewY:180}},{t:this.text,p:{scaleX:1,x:511,y:216.35,text:"The system takes you back to the patient's record where you can see all plotted visits. \n\nEvery patient needs a Case Conference, so lets put one in. Press 'Other Forms'. ",font:"20px 'Times'",lineHeight:22,lineWidth:347}}]},1).to({state:[]},1).to({state:[{t:this.instance_1,p:{scaleX:0.509,scaleY:0.3296,x:706.65,y:555,skewY:180}},{t:this.text,p:{scaleX:1,x:490.5,y:586.3,text:"A Case Conference asks for the Progress and Plan for the patient. You've already typed this up in your Evaluation, so there is no need to re-write it. Let's just copy and paste from your Evaluation. \n\nSelect 'View Past Notes' ",font:"20px 'Times'",lineHeight:22,lineWidth:366}}]},2).to({state:[{t:this.instance_1,p:{scaleX:0.4337,scaleY:0.2122,x:703.65,y:610,skewY:180}},{t:this.text,p:{scaleX:1,x:509.5,y:658.25,text:"Choose 'show paperwork' to open the Evaluation Notes",font:"24px 'Times'",lineHeight:26,lineWidth:302}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4337,scaleY:0.2122,x:703.65,y:457,skewY:180}},{t:this.text,p:{scaleX:1,x:523.5,y:501.3,text:"Copy your assessment and paste it in to 'Progress'",font:"24px 'Times'",lineHeight:26,lineWidth:302}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.4337,scaleY:0.2122,x:703.65,y:457,skewY:180}},{t:this.text,p:{scaleX:1,x:523.5,y:501.3,text:"Copy your verbal order and paste it in to 'Plan'",font:"24px 'Times'",lineHeight:26,lineWidth:302}}]},1).to({state:[{t:this.instance_1,p:{scaleX:0.2995,scaleY:0.1861,x:699.6,y:612,skewY:180}},{t:this.text,p:{scaleX:1,x:574,y:632.25,text:"Easy! Done! \nThe rest you know. Sign, date, and Finalize. ",font:"24px 'Times'",lineHeight:26,lineWidth:237}}]},1).to({state:[]},1).wait(1));

